  `mun_resi` varchar(10) DEFAULT NULL,
  `loc_resi` varchar(8) DEFAULT NULL,
  `sintomas` varchar(1) DEFAULT NULL,
  `dt_sinto` date NOT NULL DEFAULT '2001-01-01',
  `cod_ocup` varchar(2) DEFAULT NULL,
  `uf_infec` varchar(2) DEFAULT NULL,
  `pais_inf` varchar(3) DEFAULT NULL,
