  `gestante` varchar(20) DEFAULT NULL,
  `vivax` varchar(3) DEFAULT NULL,
  `falciparum` varchar(3) DEFAULT NULL,
  `niv_esco` varchar(3) DEFAULT NULL,
  PRIMARY KEY (`cod_noti`,`mun_noti`,`uf_notif`,`cod_unin`,`cod_agen`,`dt_notif`),
  KEY `fk_notificacao_unisaude_idx` (`cod_unin`),
  KEY `fk_notificacao_municipio_idx` (`mun_noti`),
  KEY `fk_notificacao_agentes1_idx` (`cod_agen`),
